import React,{useRef} from "react";
import {useNavigate,Link} from "react-router-dom"
import Canvas from "./Canvas";
import {Button ,Container} from "react-bootstrap"
import 'bootstrap/dist/css/bootstrap.min.css';
import RegionsList from "./RegionsList";
import useStore from "../store";

function Task() {

  return (
    <React.Fragment>
      <div className="container">
            <h2 className="text-center mt-6">Image annotate prototype</h2>
              <p className="description">Draw objects conturs on top of the image</p>
            <div className="container">
              <div className="row">            
              
              <div className="Task-container col-8">
              <Canvas />        
              </div>
              <div className="left-panel col-3">
                 Brigthess
                
                     <RegionsList />          
                </div>
                <button onClick={back} className="next sum">Next &raquo;</button>    
              </div>
            </div>
      </div>
           
  </React.Fragment>
);
};

export default Task
